       phno:7896541235
   }]
       
    const result=cities.map( (res,index)=><li key={index}>{res}</li>);

    return (<>

           <div className="container py-5">
           
                 <h3>PARENT COMPONENT</h3>
              
                 <ul>{result}</ul>

                  <Child cities={result} />

           </div>

            </>)
}

export default Propsobject
